import React from "react";
import NavBar from "../components/layout/Navbar";
import './home.css';

const Home = () => {
  return (
    <div>
      <NavBar />
      <div className="hero">
        <h1>Welcome to Our Blog</h1>
      </div>
      <div className="gallery">
        <ul className="controls">
          <li className="buttons active" data-filter="all">all</li>
          <li className="buttons" data-filter="ice-cream">ice-cream</li>
          <li className="buttons" data-filter="chocolate">chocolate</li>
          <li className="buttons" data-filter="cake">cake</li>
          <li className="buttons" data-filter="juice">juice</li>
          <li className="buttons" data-filter="sandwich">sandwich</li>
        </ul>
        <div className="image-container">
          {images.map((image, index) => (
            <a
              href={image.url}
              className={`image ${image.category}`}
              key={index}
            >
              <img src={image.url} alt={image.category} />
            </a>
          ))}
        </div>
      </div>
    </div>
  );
};

const images = [
  { url: "images/ice-cream1.jpg", category: "ice-cream" },
  { url: "images/ice-cream2.jpg", category: "ice-cream" },
  { url: "images/ice-cream3.jpg", category: "ice-cream" },
  { url: "images/chocolate1.jpg", category: "chocolate" },
  { url: "images/chocolate2.jpg", category: "chocolate" },
  { url: "images/cake1.jpg", category: "cake" },
  { url: "images/cake2.jpg", category: "cake" },
  { url: "images/cake3.jpg", category: "cake" },
  { url: "images/cake4.jpg", category: "cake" },
  { url: "images/cake5.jpg", category: "cake" },
  { url: "images/juice1.jpg", category: "juice" },
  { url: "images/juice2.jpg", category: "juice" },
  { url: "images/juice3.jpg", category: "juice" },
  { url: "images/sandwich1.jpg", category: "sandwich" },
  { url: "images/sandwich2.jpg", category: "sandwich" },
  { url: "images/sandwich3.jpg", category: "sandwich" },
  { url: "images/sandwich4.jpg", category: "sandwich" },
];

export default Home;
